import project1 from "../assets/project111.jpg";
import project2 from "../assets/Project22.jpg";
import project3 from "../assets/Project33.jpg";
import project4 from "../assets/project4.jpg";

const PROJECTS = [
  {
    id: 1,
    title: "Self Driving Car Software",
    description:
      "This powerful simulation built using hands on skills in neural networks which could be brought to any project.",
    link: "https://github.com/Svaity/Self-Driving-Car-Software",
    image: project1
  },
  {
    id: 2,
    title: "ReactMusic",
    description:
      "A full-stack app from scratch with a GraphQL API made with Python (Django and Graphene), a React client app",
    link: "https://github.com/Svaity/ReactMusic",
    image: project2
  },
  {
    id: 3,
    title: "Pet adoption System",
    description:
      "Pet adoption system for shelters that makes it easy to track animal status, classify and manage animal data.",
    link: "https://github.com/Svaity/Pet-adoption-System",
    image: project3
  },
  {
    id: 4,
    title: "Portfolio using Django Postgres",
    description:
      "Used Python with Django with Python , Bootstrap, Postgres to create a portfolio website",
    link: "https://github.com/Svaity/Portfolio-using-Django-Postgres",
    image: project4
  }
];

export default PROJECTS;
